
use std::string;
use actix_web::{get, post, HttpResponse, Responder, web, Result};
use serde::{Serialize, Deserialize};

#[derive(Serialize, Deserialize)]
pub struct Agreement {
    pub agreement_data: String,
    pub data_type: String
}

impl Agreement {
    fn to_string(&self) {
        println!("Agreement type: {}", self.data_type);
        println!("Agreement data: {}", self.agreement_data);
    }
}

#[derive(Serialize)]
pub struct Success {
  pub status: String,
  pub code: String
}

#[get("/get")]
pub async fn get_agreement() -> Result<impl Responder> {
    let agreement_data: Agreement = Agreement { 
      agreement_data: String::from("data:application/pdf;base64,")
    , data_type: String::from("PDF")
    };
    return Ok(web::Json(agreement_data));
}

#[post("/save")]
pub async fn save_agreement(req: web::Json<Agreement>) -> Result<impl Responder> {
  req.to_string();
  return Ok(web::Json(Success{status: String::from("SUCCESS"), code: String::from("200")}));
}